script:
const size = 32;
const origin = { x: size * -0.5, z: size * -0.5 };

reset();

sphere(-1, 20, -1, 28, 2);
for (let x = 0; x < 2; x += 1) {
  for (let z = 0; z < 2; z += 1) {
    cylinder(
      origin.x - 1 + x * size,
      0,
      origin.z - 1 + z * size,
      'y', 5, 40, 2
    );
  }
}

sphere(-1, 20, -1, 26, 1);
sphere(-1, 20, -1, 25, 0);
cylinder(-1, 0, -1, 'y', 20, 1, 2);
cylinder(-1, 0, -1, 'y', 19, 1, 1);
cylinder(-1, 42, -1, 'y', 10, 4, 1);
cylinder(-1, 42, -1, 'y', 8, 7, 0);

for (let x = 0; x < 2; x += 1) {
  for (let z = 0; z < 2; z += 1) {
	cylinder(
      origin.x + x * (size - 2),
      0,
      origin.z + z * (size - 2),
      'y', 4, 39, 1
    );
  }
}


const elevator = {
  x: origin.x + 12,
  y: 8,
  z: origin.z + size + 7,
};

box(
  elevator.x, elevator.y, elevator.z,
  8, 10, 1,
  1
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  6, 8, 6,
  2
);

box(
  elevator.x + 2, elevator.y + 2, elevator.z + 2,
  4, 5, 4,
  0
);
box(
  elevator.x + 3, elevator.y + 2, elevator.z,
  2, 4, 2,
  0
);
